import React from 'react';
import '../App.css';
import Card from './card';
import carddata from '../carddata';

function Row() {

  const  addingcards = carddata.datas.map(card => {
    return(
     <Card
      key = {card.id}
      id= {card.id}
      name= {card.name}
      value= {card.value}
     />)    
  })

  return (
    <div className="leftHeaderItems">
        {addingcards}
    </div>
  );

};  

export default Row;
